import React from 'react';
import moment from 'moment';
import './calendar.css';
const Calendar = () =>{
     weekdayshort = moment.weekdayShort();
     weekdayshortname = this.weekdayshort.map(day =>{

      return (<th key = {day} className = "week-day">
              {day}
          </th>);
     });

};

 export default Calendar;
